INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 0.029, 105, 0, 101, 1.5, 122601, 1, 110, 1, 1, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 0, 160);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 0.014, 111, 0, 102, 2.5, 122401, 3, 105, 2, 2, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 1, 120);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 0.017, 105, 1, 103, 2.5, 122501, 2, 110, 3, 3, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 0, 350);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 0.016, 105, 0, 104, 1.5, 107501, 3, 110, 4, 4, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 1, 130);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 0.014, 105, 0, 105, 2.5, 107601, 1, 110, 5, 5, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 0, 160);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 0.029, 103, 1, 106, 3.5, 107801, 2, 120, 6, 6, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 0, 255);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 0.013, 103, 0, 107, 3.5, 110601, 1, 120, 7, 7, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 0, 160);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 0.014, 103, 1, 108, 2.5, 110401, 2, 110, 8, 8, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 0, 350);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 0.012, 100, 0, 109, 1.5, 110501, 3, 105, 9, 9, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 1, 130);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 0.014, 103, 0, 110, 2.5, 115701, 1, 105, 10, 10, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 0, 200);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 0.071, 103, 1, 111, 2.5, 113601, 2, 105, 11, 11, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 0, 350);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 0.014, 103, 0, 112, 1.5, 107901, 3, 120, 12, 12, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 1, 130);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 0.022, 105, 0, 113, 1.5, 108001, 2, 110, 13, 13, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 0, 200);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 0.031, 108, 0, 114, 2.5, 110301, 1, 110, 14, 14, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 0, 160);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 0.036, 105, 0, 115, 0.5, 107701, 1, 110, 15, 15, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 1, 130);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 0.048, 95, 1, 116, 3.5, 113101, 2, 110, 16, 16, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 0, 350);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 0.043, 105, 0, 117, 1.5, 113301, 3, 105, 17, 17, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 1, 130);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 0.018, 95, 0, 118, 1.5, 113201, 2, 105, 18, 18, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 1, 130);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 0.021, 108, 0, 119, 2.5, 117001, 2, 110, 19, 19, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 0, 160);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 0.036, 105, 1, 120, 2.5, 113501, 1, 110, 20, 20, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 0, 255);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 0.02, 105, 1, 121, 2.5, 113401, 3, 105, 21, 21, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 0, 350);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 0.018, 105, 0, 122, 2.5, 110101, 1, 110, 22, 22, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 1, 130);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 0.03, 111, 0, 123, 3.5, 110001, 3, 105, 23, 23, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 0, 160);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 0.027, 103, 0, 124, 1.5, 117201, 1, 110, 24, 24, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 1, 130);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 0.02, 108, 0, 125, 3.5, 117301, 2, 105, 25, 25, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 0, 160);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 0.04, 105, 1, 126, 2.5, 117401, 3, 110, 26, 26, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 0, 350);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 0.009, 105, 1, 127, 3.5, 117101, 1, 110, 27, 27, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 0, 350);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 0.022, 105, 1, 128, 3.5, 122901, 1, 120, 28, 28, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 0, 255);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 0.028, 105, 0, 129, 2.5, 122801, 3, 110, 29, 29, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 1, 130);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 0.023, 108, 0, 130, 3.5, 122701, 2, 105, 30, 30, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 0, 130);
